exports=async function(bid,options){const{parseCatalogPaginate,cleanCatalogWrapper}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://lingjingxingzhe.com/book/${bid}/${1===page?"":"index_"+page+".html"}`,".section-list",{...options,clientOptions,pageSize:20,totalPagesRegex:/for\s*\([a-z]+ [a-z]\s*=\s*1\s*;\s*[a-z]\s*<=\s*(?<totalPages>\d+);/})};